import React from 'react';

const Footer = () => {
    return (
        <section className="row">
            
           <div className="d-flex col-md-3">
           <div className="bg-success">
                <p>asasas</p>
            </div>

            <div className="bg-dark">
            <p>asasas</p>
            </div>

            <div>
            <p>asasas</p>
            </div>

            <div className="bg-success">
            <p>asasas</p>
            </div>

           </div>
        </section>
    );
};

export default Footer;
